import React from 'react'
import PropTypes from 'prop-types';

export default function Text_area(props) {


  return (
    <div>
        <h4 className='colorw'>{props.heading}</h4>

<textarea rows="2" value={props.results} cols="50" disabled>

</textarea>
<div className='d-inline-flex'  >
    <input placeholder='Enter text to add'></input>
<input placeholder='Id for below function'></input>
</div>


{props.text1!==""?<button> {props.text1}</button>
:<></>}

&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
{props.text2!==""?<button> {props.text2}</button>
:<></>}

{props.text3!==""?<button> {props.text3}</button>
:<></>}

{props.text4!==undefined?<button> {props.text4}</button>
:<></>}


    </div>
  )
}
